import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';
import TableComponent from './TableComponent';

import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from "react";
export default class index extends Component{ 
  courses = [
    {id : 1,    courseName: 'First',            prefix: 'FIR',  languages: '1',     grade: 'G'},
    {id : 2,    courseName: 'Second',           prefix: 'SEC',  languages: '2',     grade: 'G'},
    {id : 3,    courseName: 'Third',            prefix: 'THR',  languages: '3',     grade: 'G'},
    {id : 4,    courseName: 'Fourth',           prefix: 'FOU',  languages: '4',     grade: 'G'},
  ]
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>

    <TableComponent />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
